    def gaussian(mean,stdev)
        y2 = y2
        use_last = false
        y1 = y1
        if use_last
            y1 = y2
            use_last = false
        else
            x1 = x1
            x2 = x2
            w = w
          loop do
            x1 = 2.0 * rand - 1.0
            x2 = 2.0 * rand - 1.0
            w  = x1 * x1 + x2 * x2
            break unless w >= 1.0
         end
            w = Math.sqrt((-2.0 * Math.log(w)) / w)
            y1 = x1 * w
            y2 = x2 * w
            use_last = true
      end
        retval = mean + stdev * y1
        if retval > 0
             retval
          else
             -retval
        end
    end


