     def age_dep_fn(age,type)
       age_dep = {'Seul' => def a(x) return 1.846736 - 0.04778711*x + 0.0005686968*x*x end,'Couple sans enfant' => def b(x) return 9.952353 - 0.5981889*x + 0.01236495*x*x - 0.0000808566*x*x*x end,'Famille monoparentale' => def c(x) return -0.7031012 + 0.0807123*x - 0.0008450134*x*x end,'Couple avec enfant' => def d(x) return -1.283366 + 0.1185968*x - 0.0013342*x*x end}
       age = age
       type = type
       age = 24 if age <= 24
       age = 70 if age >= 70
       if type == 'Seul'
          single = method(age_dep['Seul'])
          return (single.call(age)-1)*0.19 + 1
        elsif type == 'Couple sans enfant'
          couple = method(age_dep['Couple sans enfant'])
          return (couple.call(age)-1)*0.19 + 1
        elsif type == 'Famille monoparentale'
          mono = method(age_dep['Famille monoparentale'])
          return (mono.call(age)-1)*0.19 + 1
        elsif type == 'Couple avec enfant'
          family = method(age_dep['Couple avec enfant'])
          return (family.call(age)-1)*0.19 + 1
        end
     end


